import React from 'react' ;
import './header.css';

const Header = () => {
  return (
    <div className='mirror__header section__padding' id='home'>
      <div className='mirror__header-content'>
        <h1 className='gradient__text'>A new way to revolutionise your safety, just by a scan BFHFBWHWIHWIOHNVKBVK</h1>

      </div>
    </div>
  )
}

export default Header
